// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/*
 * STEP 3 â€” ACCESS CONTROL + MINTING RULES + PAUSING
 *
 * This version now includes:
 *  - Owner/admin
 *  - onlyOwner modifier
 *  - Pausing/unpausing
 *  - Safe mint rules (max supply, zero address check, duplicate ID check)
 */

contract NftCollection {

    // ---------------------------------------------------------
    // STATE VARIABLES
    // ---------------------------------------------------------

    string public name;
    string public symbol;

    uint256 public maxSupply;
    uint256 public totalSupply;

    address public owner;               // Admin/contract owner
    bool public paused;                 // Pause minting if needed

    mapping(uint256 => address) private _owners;
    mapping(address => uint256) private _balances;

    mapping(uint256 => address) private _tokenApprovals;
    mapping(address => mapping(address => bool)) private _operatorApprovals;


    // ---------------------------------------------------------
    // MODIFIERS
    // ---------------------------------------------------------

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    modifier whenNotPaused() {
        require(!paused, "Minting paused");
        _;
    }


    // ---------------------------------------------------------
    // CONSTRUCTOR
    // ---------------------------------------------------------
    constructor(
        string memory _name,
        string memory _symbol,
        uint256 _maxSupply
    ) {
        name = _name;
        symbol = _symbol;
        maxSupply = _maxSupply;
        totalSupply = 0;
        owner = msg.sender; // deployer becomes admin
        paused = false;
    }


    // ---------------------------------------------------------
    // ADMIN FUNCTIONS
    // ---------------------------------------------------------

    function pause() external onlyOwner {
        paused = true;
    }

    function unpause() external onlyOwner {
        paused = false;
    }


    // ---------------------------------------------------------
    // ERC-721 REQUIRED FUNCTION SKELETONS
    // (Logic will be completed further in Steps 4 & 5)
    // ---------------------------------------------------------

    function balanceOf(address wallet) public view returns (uint256) {
        require(wallet != address(0), "Zero address invalid");
        return _balances[wallet];
    }

    function ownerOf(uint256 tokenId) public view returns (address) {
        address currentOwner = _owners[tokenId];
        require(currentOwner != address(0), "Token does not exist");
        return currentOwner;
    }


    // ---------------------------------------------------------
    // MINTING (FULLY IMPLEMENTED IN STEP 3)
    // ---------------------------------------------------------

    function safeMint(address to, uint256 tokenId)
        public
        onlyOwner
        whenNotPaused
    {
        require(to != address(0), "Cannot mint to zero address");
        require(!_exists(tokenId), "Token already exists");
        require(totalSupply < maxSupply, "Max supply reached");

        _mint(to, tokenId);
    }

    // internal mint helper
    function _mint(address to, uint256 tokenId) internal {
        _owners[tokenId] = to;
        _balances[to] += 1;
        totalSupply += 1;
    }


    // ---------------------------------------------------------
    // PLACEHOLDER FUNCTIONS (will be completed in Step 4 & 5)
    // ---------------------------------------------------------

    function transferFrom(address from, address to, uint256 tokenId) public {
        // Implemented later
    }

    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory data) public {
        // Implemented later
    }

    function approve(address to, uint256 tokenId) public {
        // Will be implemented later
    }

    function setApprovalForAll(address operator, bool approved) public {
        _operatorApprovals[msg.sender][operator] = approved;
    }

    function getApproved(uint256 tokenId) public view returns (address) {
        return _tokenApprovals[tokenId];
    }

    function isApprovedForAll(address wallet, address operator) public view returns (bool) {
        return _operatorApprovals[wallet][operator];
    }

    function tokenURI(uint256 tokenId) public view returns (string memory) {
        require(_exists(tokenId), "Cannot query non-existent token");
        return ""; // Will be implemented later
    }


    // ---------------------------------------------------------
    // INTERNAL HELPERS
    // ---------------------------------------------------------

    function _exists(uint256 tokenId) internal view returns (bool) {
        return _owners[tokenId] != address(0);
    }

    function _isApprovedOrOwner(address spender, uint256 tokenId)
        internal
        view
        returns (bool)
    {
        // Implementation will be added later
        return false;
    }
}

